function aaa___performance_test___ComputeNonCryptHash
%this function can be used as a performance tester
%
%This uses a mat file with several values (a list of English words, a list of numbers (as char),
%and a mix of other data types). It is automatically downloaded to the temp folder, but you can
%also download it manually:
%    http://web.archive.org/web/20200706113927/
%    https://hjwisselink.nl/FEXsubmissiondata/76832-computenoncrypthash/HashTestLib.mat

clc
[AllTests,names]=retrieve_all_tests;
for t=1:numel(AllTests)
    fprintf('\nCurrent test category: %s',names{t})
    currentTest=AllTests{t};
    N=min(numel(currentTest),2^14);%limits number of test cases to speed up the test
    if N==numel(currentTest)
        fprintf('\n');
    else
        fprintf(' (%.1f%% of dataset)\n',100*N/numel(currentTest));
    end
    
    nBits_list=[16 32 48 64 128 256];
    mus_per_hash=zeros(size(nBits_list));
    collisions=zeros(size(nBits_list));
    
    for idx=1:numel(nBits_list)
        nBits=nBits_list(idx);
        
        hashes=char(zeros(numel(currentTest),nBits/4));%stored in hex, so bits/4 chars
        then=now;
        for n=floor(linspace(1,numel(currentTest),N))
            hashes(n,:)=ComputeNonCryptHash(currentTest{n},nBits);
        end
        time_elapsed=(now-then)*(24*60*60*1000);%in ms
        hashes(any(hashes==0,2),:)=[];%in case of skipped entries (note: this doesn't test =='0')
        
        mus_per_hash(idx)=time_elapsed/N;
        collisions(idx)=N-size(unique(hashes,'rows'),1);
        Q=findHashQualityEstimation(hashes,nBits);
        if isa(currentTest{n},'char')
            time_per_hash=mus_per_hash(idx)*1000;
            timescale='microsecond';
        else
            timescale='millisecond';
            time_per_hash=mus_per_hash(idx);
        end
        fprintf('for %d bits hashes: %.0f %s per hash, with %d collisions (Q=%.1f)\n',...
            nBits_list(idx),time_per_hash,timescale,collisions(idx),Q)
        
        % LUT=zeros(1,70);LUT(double('1234567890ABCDEF'))=1:16;
        % d=LUT(hashes);e=[];
        % for n=1:size(d,2)
        %     e(:,n)=histc(d(:,n),0.5:17.5);
        % end
        % e=e(1:16,:);
        % e=e./mean(e);
        % surf(e),view(0,90),colorbar,caxis([0.9 1.1])
    end
end
end
function [AllTests,names]=retrieve_all_tests
%example taken from: https://softwareengineering.stackexchange.com/questions/49550/
%                                          which-hashing-algorithm-is-best-for-uniqueness-and-speed
%
%retrieving of the English word list only works if the Timeout can be increased, hence the mat file
matfilepath =fullfile(fileparts(mfilename('fullpath')),'HashTestLib.mat');
matfilepath2=fullfile(tempdir,'HashTestLib.mat');
if exist(matfilepath,'file')
    S=load(matfilepath);
    [AllEnglishWords,Numbers,Images,NumAsDouble]=deal(...
        S.AllEnglishWords,S.Numbers,S.Images,S.NumAsDouble);
else
    if exist(matfilepath2,'file')
        S=load(matfilepath2);
        [AllEnglishWords,Numbers,Images,NumAsDouble]=deal(...
            S.AllEnglishWords,S.Numbers,S.Images,S.NumAsDouble);
    else
        try
            %attempt to download the mat file to the temp dir
            %link for manual download:
            %    http://web.archive.org/web/20200706113927/
            %    https://hjwisselink.nl/FEXsubmissiondata/76832-computenoncrypthash/HashTestLib.mat
            url=['https://hjwisselink.nl/FEXsubmissiondata/',...
                '76832-computenoncrypthash/HashTestLib.mat'];
            try
                WBM(matfilepath2,url,'flag','id');
            catch
                websave(matfilepath2,url,weboptions('Timeout',20))
            end
        catch
            %allow re-creation of the mat file in the current folder
            AllEnglishWords=get_AllEnglishWords;
            Numbers=get_Number;
            [Images,NumAsDouble]=more_testcases;
            
            save2mat({matfilepath,'aaa___test___ComputeNonCryptHash'},...
                AllEnglishWords,Numbers,Images,NumAsDouble);
        end
    end
end
%OUTSOURCING and OUTSOURCINGS are in the word list twice, so remove 1 copy. Otherwise we will get
%at least 2 hash collisions reported for any length hash.
AllEnglishWords=unique(AllEnglishWords);

AllTests={AllEnglishWords,Numbers,Images,NumAsDouble};
names={'English words','Numbers (in char)','Images','Numbers (in double)'};
end
function AllEnglishWords=get_AllEnglishWords
persistent AllEnglishWords_
if ~isempty(AllEnglishWords_)
    AllEnglishWords=AllEnglishWords_;
    return
end
AllEnglishWords=['http://web.archive.org/web/20061231134037/',...
    'http://www.sitopreferito.it/html/all_english_words.html'];
AllEnglishWords=webread(AllEnglishWords,weboptions('Timeout',20));

pat='<tr align="LEFT" valign="TOP">';
start=strfind(AllEnglishWords,pat)+numel(pat);
stop=strfind(AllEnglishWords,'</table>')-1;
stop(stop<start)=[];stop=stop(1);
AllEnglishWords=AllEnglishWords(start:stop);

AllEnglishWords(AllEnglishWords<65 | AllEnglishWords>90)=' ';
AllEnglishWords=stringtrim(AllEnglishWords);
AllEnglishWords=[AllEnglishWords ' ' lower(AllEnglishWords)];
AllEnglishWords=regexp_outkeys(AllEnglishWords,' ','split');

AllEnglishWords_=AllEnglishWords;
end
function Numbers=get_Number
persistent Numbers_
if ~isempty(Numbers_)
    Numbers=Numbers_;
    return
end
Numbers=cell(1,216553);
for n=1:numel(Numbers)
    Numbers{n}=sprintf('%d',n);
end
Numbers_=Numbers;
end
function [Images,NumAsDouble]=more_testcases
str_block=[ComputeNonCryptHash(1,512);ComputeNonCryptHash(2,512);ComputeNonCryptHash(3,512)];
Images=cell(1,2);%force direction of expansion
Images{1}=hex2im(str_block);%note: this is a logical
im=get_example_im;
Images{2}=im;
Images{3}=im(:,:,1);
Images{4}=im(:,:,2);
Images{5}=im(:,:,3);
NumAsDouble=cell(1,2);%force direction of expansion
NumAsDouble{1}=1;
NumAsDouble{2}=linspace(0,100,1000);
NumAsDouble{3}=reshape(uint32(1:100:10^8),1000,[]);
NumAsDouble{4}=-1000:1000;
NumAsDouble{5}=NumAsDouble{4};NumAsDouble{5}(NumAsDouble{5}<0)=0;
end
function Q=findHashQualityEstimation(hashes,nBits)
%sources:
%https://web.archive.org/web/20200222223240/https://www.strchr.com/hash_functions
%https://en.wikipedia.org/wiki/Compilers:_Principles,_Techniques,_and_Tools
[x1,x2,x3]=unique(hashes,'rows'); %#ok<ASGLU>
try
    %the extra 0 in this h doesn't matter because of the multiplication later
    %the different orientation doesn't matter either
    h=histc(x3,0.5:(max(x3)+0.5)); %#ok<HISTC>
catch
    h=histcounts(x3,0.5:(max(x3)+0.5));
end
n=size(hashes,1);%total number of items
m=2^nBits;       %number of slots
bj=h;            %number of items in the j-th slot
m2=2*m;
Q=sum(bj.*(bj+1))/(2*(n/m2)*(n+m2-1));
end
function date_correct=check_date(outfilename,date_part,m_date_r,SaveAttempt)
%Check if the date of the downloaded file matches the requested date.
%
%There are two strategies. Strategy 1 is guaranteed to be correct, but isn't always possible.
%Strategy 2 could give an incorrect answer, but is possible in more situations. In the case of
%non-web page files (like e.g. an image), both will fail. This will trigger a missing date error,
%for which you need to input a missing date response (m_date_r).
%
%Strategy 1:
%Rely on the html for the header to provide the date of the currently viewed capture.
%Strategy 2:
%Try a much less clean version: don't rely on the top bar, but look for links that indicate a link
%to the same date in the Wayback Machine. The most common occurring date will be compared with
%date_part.

if ~exist(outfilename,'file')
    date_correct=false;return
    %If the file doesn't exist (not even as a 0 byte file), evidently something went wrong, so
    %retrying or alerting the user is warranted.
end
%Loading an unsaved page may result in a capture of the live page (but no save in the WBM). If this
%happens the time in the file will be very close to the current time if this is the case. If the
%save was actually triggered this is valid, but if this is the result of a load attempt, it is
%unlikely this is correct, in which case it is best to trigger the response to an incorrect date:
%attempt an explicit save.
%Save the time here so any time taken up by file reading and processing doesn't bias the estimation
%of whether or not this is too recent.
if ~SaveAttempt
    currentTime=WBM_getUTC_local;
end

%Strategy 1:
%Rely on the html for the header to provide the date of the currently viewed capture.
StringToMatch='<input type="hidden" name="date" value="';
data=readfile(outfilename);
%ismember can result in a memory error in ML6.5
%ismembc only allows numeric, logical, or char inputs (and Octave lacks it)
%pos=find(ismember(data,'<td class="u" colspan="2">'));
pos=0;
while pos<=numel(data) && (pos==0 || ...
        ~strcmp(stringtrim(data{pos}),'<td class="u" colspan="2">'))
    pos=pos+1;
end
if numel(data)>=(pos+1)
    line=data{pos+1};
    idx=strfind(line,StringToMatch);
    idx=idx+length(StringToMatch)-1;
    date_correct=strcmp(line(idx+(1:length(date_part))),date_part);
    return
end
%Strategy 2:
%Try a much less clean version: don't rely on the top bar, but look for links that indicate a link
%to the same date in the Wayback Machine. The most common occurring date will be compared with
%date_part.
%already loaded: data=readfile(outfilename);
%data(:,2)={' '};data=data';
data=data(:)';data=cell2mat(data);
%data is now a single long string
idx=strfind(data,'/web/');
if numel(idx)==0
    if m_date_r==0     %ignore
        date_correct=true;
        return
    elseif m_date_r==1 %warning
        warning('HJW:WBM:MissingDateWarning',...
            'No date found in file, unable to check date, assuming it is correct.')
        date_correct=true;
        return
    elseif m_date_r==2 %error
        error('HJW:WBM:MissingDateError',...
            ['Could not find date. This can mean there is an ',...
            'error in the save. Try saving manually.'])
    end
end
datelist=cell(size(idx));
data=[data 'abcdefghijklmnopqrstuvwxyz'];%avoid error in the loop below
if exist('isstrprop','builtin')
    for n=1:length(idx)
        for m=1:14
            if ~isstrprop(data(idx(n)+4+m),'digit')
                break
            end
        end
        datelist{n}=data(idx(n)+4+(1:m));
    end
else
    for n=1:length(idx)
        for m=1:14
            if ~any(double(data(idx(n)+4+m))==(48:57))
                break
            end
        end
        datelist{n}=data(idx(n)+4+(1:m));
    end
end
[a,ignore_output,c]=unique(datelist);%#ok<ASGLU> ~
%In some future release, histc might not be supported anymore.
try
    [ignore_output,c2]=max(histc(c,1:max(c)));%#ok<HISTC,ASGLU>
catch
    [ignore_output,c2]=max(accumarray(c,1)); %#ok<ASGLU>
end
line=a{c2};
date_correct=strcmp(line((1:length(date_part))),date_part);

if ~SaveAttempt
    %Check if the time in the file is too close to the current time to be an actual loaded capture.
    %Setting this too high will result in too many save triggers, but setting it too low will lead
    %to captures being missed on slower systems/networks. 15 seconds seems a reasonable middle
    %ground.
    %One extreme situation to be aware of: it is possible for a save to be triggered, the request
    %arrives successfully and the page is saved, but the response from the server is wrong or
    %missing, triggering an HTTP error. This may then lead to a load attempt. Now we have the
    %situation where there is a save of only several seconds old, but the the SaveAttempt flag is
    %false. The time chosen here must be short enough to account for this situation.
    %Barring such extreme circumstances, page ages below a minute are suspect.
    
    if numel(line)<14%Something is wrong
        %Trigger missing date response. This shouldn't happen, so offer a gracefull exit.
        if m_date_r==0     %ignore
            date_correct=true;
            return
        elseif m_date_r==1 %warning
            warning('HJW:WBM:MissingDateWarning',...
                'No date found in file, unable to check date, assuming it is correct.')
            date_correct=true;
            return
        elseif m_date_r==2 %error
            error('HJW:WBM:MissingDateError',...
                ['Could not find date. This can mean there is an ',...
                'error in the save. Try saving manually.'])
        end
    end
    
    %convert the date found to a format that the ML6.5 datenum supports
    line={line(1:4),line(5:6),line(7:8),...  %date
        line(9:10),line(11:12),line(13:14)}; %time
    line=str2double(line);
    timediff=(currentTime-datenum(line))*24*60*60;
    if timediff<10%seconds
        date_correct=false;
    elseif timediff<60%seconds
        warning('HJW:WBM:LivePageStored',...
            ['The live page might have been saved instead of a capture.',char(10),...
            'Check on the WBM if a capture exists.']) %#ok<CHARTEN>
    end
end
end
function outfilename=check_filename(filename,outfilename)
%It can sometimes happen that the outfilename provided by urlwrite is incorrect. Therefore, we need
%to check if either the outfilename file exists, or the same file, but inside the current
%directory. It is unclear when this would happen, but it might be that this only happens when the
%filename provided only contains a name, and not a full or relative path.
outfilename2=[pwd filesep filename];
if ~strcmp(outfilename,outfilename2)
    if ~exist(outfilename,'file') && ...
            exist(outfilename2,'file')
        outfilename=outfilename2;
    end
end
end
function im=get_example_im
%created with this from a png:
% im=im(:);%linearize
% b1=rem(im,16);b2=((im-b1)/16);%split in hex parts
% im_as_char=char('a'+[b1;b2]);%encode as char
% im_as_cellstr=mat2cell(im_as_char',1,80*ones(numel(im_as_char)/80,1));
im=get_example_im___im_as_char;
middle=numel(im)/2;
b1=im(1:middle);
b2=im((middle+1):end);
b1=b1-'a';b2=b2-'a';
im=uint8(b1+b2*16);
im=reshape(im,400,400,3);
end
